import React from "react";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import Login from ".././screens/login/Components/Login";
import ForgotPassword from ".././screens/forgotPassword/Components/ForgotPassword";
import Register from ".././screens/register/Components/Register"
import Home from ".././screens/home/Component/Home";

const Navigation = () =>{

    return (
        <BrowserRouter>
          <Switch>
            <Route exact path = "/" component = {Home}/>
            <Route exact path = "/register" component = {Register}/>
            <Route exact path = "/forgotpassword" component = {ForgotPassword} />
            <Route epath = "/login" component  = {Login}/>
          </Switch>
        </BrowserRouter>
      );
}

export default Navigation;
